#include<bits/stdc++.h>
using namespace std;
namespace whatever{
	int readu(){
		char ch=getchar();
		while(!isdigit(ch))
			ch=getchar();
		int value=ch-'0';
		ch=getchar();
		while(isdigit(ch)){
			value=value*10+ch-'0';
			ch=getchar();
		}
		return value;
	}
	void writeu(int n){
		if(n<10)
			putchar(n+'0');
		else{
			writeu(n/10);
			putchar(n%10+'0');
		}
	}
	const char *str="";
	bool is_not_prime[1000000+1];
	int prime[1000000/8];
	int prime_cnt;
	uint8_t cnt[1000000+1];
	int other[1000000+1];
	void sieve(){
		for(int i=2; i<=1000000; ++i){
			if(!is_not_prime[i]){
				prime[++prime_cnt]=i;
				cnt[i]=1;
				other[i]=1;
			}
			for(int j=1; j<=prime_cnt; ++j){
				int p=prime[j];
				int next=p*i;
				if(next>1000000)
					break;
				is_not_prime[next]=true;
				if(i%p==0){
					cnt[next]=cnt[i]+1;
					other[next]=other[i];
					break;
				}
				cnt[next]=1;
				other[next]=i;
			}
		}
	}
	vector<int> get(int a){
		vector<int> result;
		while(a!=1){
			result.push_back(cnt[a]);
			a=other[a];
		}
		sort(result.begin(), result.end());
		return result;
	}
	void run(){
		sieve();
		cerr<<"prime_cnt: "<<prime_cnt<<endl;
		vector<vector<int> > v;
		v.reserve(1000000);
		for(int i=1; i<=1000000; ++i)
			v.push_back(get(i));
		assert(v.size()==1000000);
		sort(v.begin(), v.end());
		v.erase(unique(v.begin(), v.end()), v.end());
		assert(v.size()==289);
		cerr<<"clock(): "<<clock()/double(CLOCKS_PER_SEC)<<endl;
		static int result[289][289];
		for(int i=0; i<289; ++i)
			for(int j=0; j<289; ++j)
				if(i<=j){
					assert(*str!=0);
					result[i][j]=*str++-'A';
				}
				else
					result[i][j]=result[j][i];
		assert(*str==0);
		cerr<<"clock(): "<<clock()/double(CLOCKS_PER_SEC)<<endl;
		int t=readu();
		while(--t!=-1){
			writeu(result[lower_bound(v.begin(), v.end(), get(readu()))-v.begin()][lower_bound(v.begin(), v.end(), get(readu()))-v.begin()]);
			putchar('\n');
		}
		cerr<<"clock(): "<<clock()/double(CLOCKS_PER_SEC)<<endl;
	}
}
int main(){
	whatever::run();
}